import React, {Component} from 'react';

class Fotoboek extends Component {

getFeed = async () =>{

    let res = await fetch('https://api.ellipsis-earth.com/v2/geomessage/ids',{method:'POST',  headers: {'Content-Type': 'application/json'}, body:JSON.stringify({'mapId':this.props.mapId, 'type': 'polygon', 'ids':[15]})})
    res = await res.json()
    return(res.geomessages)
  }


render(){  return (
  <div>
  <input type="button" value= "Print" onClick = {this.getFeed}/>
  </div>

  );
}
}
export default Fotoboek;
